//////////////// Paper ////////////////
function populatePaperPanel(panelName, sel, func, objs) {
  var panel = getDocElm(panelName);
  if (isNull(panel)) {
    return;
  }
  if ( isNull(objs) || objs.length==0) {
    panel.innerHTML = '';
    return;
  }
  var sb = new StringBuffer();
  for (i = 0; i < objs.length; i++) {
    sb.append("<div class='paperTreeItem");
    if (i == sel) {
      sb.append("Sel");
    }
    sb.append("' id='PTNode$");
    sb.append(objs[i].NodeId);
    sb.append("' onclick='");
    sb.append(func).append("(").append(i).append(");");
    sb.append("'><div>");
    sb.append(objs[i].Name);
    sb.append("</div></div>");
  }
  panel.innerHTML = sb.toString();
}
var selCat = 0;
var selDenom = 0;
var selType = 0;
function doPaperSelCat(i) {
  selCat=i;
  selDenom=0;
  selType=0;
  populatePaperTree();
}
function doPaperSelDom(i) {
  selDenom=i;
  selType=0;
  populatePaperTree();
}
function doPaperSelType(i) {
  selType=i;
  populatePaperTree();
}

function populatePaperTree() {
  populatePaperPanel('PaperCat', selCat, 'doPaperSelCat', paperTree.Children);
  populatePaperPanel('PaperDenom', selDenom, 'doPaperSelDom',  paperTree.Children[selCat].Children);
  if (!isNull(paperTree.Children[selCat].Children)) {
    populatePaperPanel('PaperType', selType, 'doPaperSelType', paperTree.Children[selCat].Children[selDenom].Children);
  } else {
    populatePaperPanel('PaperType', selType, 'doPaperSelType', null);
  }
}

function selectPaperValues(cat, den, type) {
 selCat = cat;
 selDenom = den;
 selType = type;
 populatePaperTree();
}

function doFindPaper() {

  //var urlAdd = '&AdvanceSearch='+TheForm.AdvanceSearch.value;
  var urlAdd = '&AdvanceSearch=0';

  var ref = '';//TheForm.Refine.value;
  urlAdd += '&PRefine=' + escapeStr(ref);
  if (true) {//TheForm.AdvanceSearch.value==1
    var nodeId='';
    var node = paperTree.Children[selCat];

    if (!isNull(paperTree.Children[selCat].Children)) {
      node = paperTree.Children[selCat].Children[selDenom];
      if (!isNull(node.Children)) {
        node = node.Children[selType];
      }
    }
    nodeId = node.NodeId;
    urlAdd += '&NodeId=' + nodeId;
  }
  displainFindResult('/ta/Coins.admin?rnd=NRQUIHTL&@impl=coins.ui.ucatalog.flat.paper.UiControl_FindResults&@windowId=SCNRM' + urlAdd);
}
